import React from 'react'

function Content() 
{
  const leftbuttontext="<";
  const rightbuttontext=">";

  function leftbuttonclick()
  {
    console.log("left button clicked");
  };

    return (
    <div class="row">
        <div class="sidebuttons col col-1 col-md-1">
          <div class="row siderowsplit">
          </div>
          <div class="row sidebuttonrow">
            <button onClick={leftbuttonclick} >{leftbuttontext}</button>
          </div>
          <div class="row siderowsplit">
          </div>
        </div>
        <div class="content col col-10 col-md-10">
          <h1 class="contenttext"> <b> Content Text </b></h1>
        </div>
        <div class="sidebuttons col col-1 col-md-1">
          <div class="sidebuttons col col-1 col-md-1">
            <div class="row siderowsplit">
            </div>
            <div class="row sidebuttonrow">
              <h1 class="buttontext"> <b> {rightbuttontext} </b></h1>
            </div>
            <div class="row siderowsplit">
            </div>
          </div>
        </div>
    </div>);
}

export default Content;
